var media_selecao;

var pattern = RegExp(posicao_selecionada);
posicao.some(function(p) {
  if (pattern.test(p.Jogador)) {   // bloqueia por expressão regular
    return media_selecao = p;
  }
});
//console.log(media_selecao);

posicao.sort(function(a, b) {
  return (b === media_selecao) - (a === media_selecao)
      || d3.ascending(a.Jogador, b.Jogador);
});

